import React from 'react';
import './Home.css'; // Importa os estilos para o componente Home
import {useHistory} from 'react-router-dom';

//import { useHistory } from 'react-router-dom'; // Importa useHistory para redirecionamento
import startImage from '../images/pngwing.com.png'; // Importa a imagem de início

const Home = () => {
  const history = useHistory(); // Inicializa o hook useHistory

  const handleStartClick = () => {
    // Redireciona para a tela de perguntas ao clicar em "Iniciar"
    history.push('/questions');
  };

  return (
    <div className="home-container">
      <h1>Tecido Osseo</h1>
      <img
        src={startImage}
        alt="Imagem Iniciar"
        onClick={handleStartClick} // Chama a função de redirecionamento ao clicar na imagem
      />
      <p>Iniciar</p>
    </div>
  );
};

export default Home;
